import React, {Component} from 'react';
import axios from 'axios';
import Navbarr from '../templates/Navbar-r'
import Button from '@material-ui/core/Button';
import { BrowserRouter as Router, Route, Link } from "react-router-dom";
import "bootstrap/dist/css/bootstrap.min.css" 
import '../Common/Home.css'

class Dashboardr extends Component {

    constructor(props) {
        super(props);
        this.state = {details: []};
    }

    componentDidMount() {
        axios.get('http://localhost:4000/user/profile') // unimplemented
             .then(response => {
                 this.setState({details: response.data});
             })
             .catch(function(error) {
                 console.log(error);
             })

    }

    render() {
        return (
            <div>
                <div>
                <ul className="navbar-nav mr-auto">
                            <li className="navbar-item">
                                <Button variant="contained" color="primary" href="/dashboard-r/create-job">Create-Job</Button>
                            </li>
                            <br></br>
                            <li className="navbar-item">
                                <Button variant="contained" color="secondary" href="/profile">My Profile</Button>
                            </li>
                            <li className="navbar-item">
                                <Button variant="contained" color="secondary" href="/created-jobs">Job-Listings</Button>
                            </li>                        
                </ul>

           </div>  
             </div>
        )
    }
}

export default Dashboardr;
